DROP TABLE IF EXISTS `fx_auth_rule`;
CREATE TABLE `fx_auth_rule` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `pid` int(11) DEFAULT NULL COMMENT '父id',
  `name` varchar(32) DEFAULT NULL COMMENT '名称',
  `path` varchar(128) DEFAULT NULL COMMENT '路径',
  `sort` int(11) DEFAULT '1' COMMENT '排序 ',
  `type` char(1) DEFAULT '1' COMMENT '1内部 2外部',
  `is_menu` char(1) DEFAULT '1' COMMENT '是否为菜单 1是',
  `desc` varchar(64) DEFAULT NULL COMMENT '描述',
  `icon` varchar(32) DEFAULT NULL COMMENT '图标',
  `create_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8 COMMENT='节点表';

