DROP TABLE IF EXISTS `fx_role`;
CREATE TABLE `fx_role` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '角色ID',
  `code` varchar(32) DEFAULT NULL,
  `role_name` varchar(64) DEFAULT NULL COMMENT '角色名称',
