  `full_url` text COMMENT '请求链接',
  `http_status` int(11) DEFAULT '0' COMMENT '请求状态',
  `response` text COMMENT '返回参数',
  `request` text COMMENT '请求参数',
  `ips` varchar(256) DEFAULT '' COMMENT '请求ip',
  `method` varchar(32) DEFAULT '' COMMENT '请求方式',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=183 DEFAULT CHARSET=utf8;

